import './App.css';
import {Ride} from './components/Ride/ride';
import 'bootstrap/dist/css/bootstrap.min.css';
import {rides} from './data/Ride';
import {user} from './data/User';
import Header from './components/Header/header';
import Navbar from './components/Navbar/navbar';

function App() {
    return (
        <div>
            <BrowserRouter basename="/">
                <Header/> {/* <Navbar/> */}
                <Routes>
                    <Route path="/" element={< NearestRides />} exact/>
                    <Route path="/upcoming-rides/" element={< UpcomingRides />} exact/>
                    <Route path="/past-rides/" element={< PastRides />} exact/>
                </Routes>
                <div className="App bg-dark">
                    {rides
                        .map(function (object, i) {
                            return <Ride ride={object} station_code={user.station_code} key={i}/>;
                        })}

                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
